import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  products:{
    margin:'0 auto',
    marginTop:100,
    width:'90%',
  },
  setingTable:{
    display:'flex',
    alignItems:'center',
    justifyContent:'end'
  },
  setingPage:{
    display:'flex'
  }
})
